import React, { useState, useEffect } from "react";
import axios from "axios";

function ConsultaRotas() {
  const [rotas, setRotas] = useState([]);
  const [editandoId, setEditandoId] = useState(null);
  const [novaOrigem, setNovaOrigem] = useState("");
  const [novoDestino, setNovoDestino] = useState("");
  const [novoValor, setNovoValor] = useState("");

  // Função para buscar as rotas do backend
  useEffect(() => {
    axios
      .get("http://localhost:5283/api/rota")
      .then((response) => setRotas(response.data))
      .catch((error) => console.error("Erro ao carregar rotas:", error));
  }, []);

  // Função para iniciar a edição de uma rota
  const handleEdit = (rota) => {
    setEditandoId(rota.id);
    setNovaOrigem(rota.origem);
    setNovoDestino(rota.destino);
    setNovoValor(rota.valor);
  };

  // Função para cancelar a edição
  const handleCancel = () => {
    setEditandoId(null);
    setNovaOrigem("");
    setNovoDestino("");
    setNovoValor("");
  };

  // Função para atualizar uma rota
  const handleUpdate = (id) => {
    const rotaAtualizada = {
      origem: novaOrigem,
      destino: novoDestino,
      valor: parseInt(novoValor, 10), // Certifique-se de que o valor seja um número
    };

    axios
      .put(`http://localhost:5283/api/rota/${id}`, rotaAtualizada)
      .then(() => {
        alert("Rota atualizada com sucesso!");
        setEditandoId(null);
        window.location.reload(); // Recarrega para refletir alterações
      })
      .catch((err) => {
        console.error("Erro ao atualizar rota:", err);
        alert("Erro ao atualizar rota.");
      });
  };

  // Função para excluir uma rota
  const handleDelete = (id) => {
    axios
      .delete(`http://localhost:5283/api/rota/${id}`)
      .then(() => {
        alert("Rota excluída com sucesso!");
        setRotas(rotas.filter((rota) => rota.id !== id));
      })
      .catch((err) => {
        console.error("Erro ao excluir rota:", err);
        alert("Erro ao excluir rota.");
      });
  };

  return (
    <div style={{ textAlign: "center", marginTop: "2rem" }}>
      <h1>Rotas Registradas</h1>
      {rotas.length === 0 ? (
        <p>Nenhuma rota encontrada.</p>
      ) : (
        <table style={{ margin: "0 auto", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th>Origem</th>
              <th>Destino</th>
              <th>Valor</th>
              <th>Ações</th>
            </tr>
          </thead>
          <tbody>
            {rotas.map((rota) =>
              editandoId === rota.id ? (
                <tr key={rota.id}>
                  <td>
                    <input
                      type="text"
                      value={novaOrigem}
                      onChange={(e) => setNovaOrigem(e.target.value)}
                    />
                  </td>
                  <td>
                    <input
                      type="text"
                      value={novoDestino}
                      onChange={(e) => setNovoDestino(e.target.value)}
                    />
                  </td>
                  <td>
                    <input
                      type="number"
                      value={novoValor}
                      onChange={(e) => setNovoValor(e.target.value)}
                    />
                  </td>
                  <td>
                    <button onClick={() => handleUpdate(rota.id)}>Salvar</button>
                    <button onClick={handleCancel}>Cancelar</button>
                  </td>
                </tr>
              ) : (
                <tr key={rota.id}>
                  <td>{rota.origem}</td>
                  <td>{rota.destino}</td>
                  <td>${rota.valor}</td>
                  <td>
                    <button onClick={() => handleEdit(rota)}>Editar</button>
                    <button onClick={() => handleDelete(rota.id)}>Excluir</button>
                  </td>
                </tr>
              )
            )}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default ConsultaRotas;
